const Index = () => (
<div>
    <ul>
        <li>
            <Link><a href="/">Home</a></Link>
        </li>
        <li>
               <Link><a href="/about">About</a></Link>
        </li>
    </ul>
    <h1>Welcome to BitValue</h1>
</div>

);

export default Index;
